import math

def Gamma(n):
    if n <= 1:
        return 1
    return math.sqrt(2 / math.factorial(n * 2))

def Gamma0(n):
    return 1

def Gamma1(n):
    return (1 / math.factorial(n))

def Gamma2(n):
    return Gamma0(n) * Gamma1(n - 2)

def Gamma3(n):
    return (2 * Gamma1(n) + (2 * Gamma1(n - 2) * Gamma2(n - 2))) / (2 * Gamma2(n - 2))

def Gamma_formula(n):
    return Gamma3(n) * 6
